import React from 'react';
import './reviewFrom.css'; // Import a separate CSS file for styling

const ReviewSummary = () => {
  return (
    <div className="review-summary">
      <div className="rating">⭐⭐⭐⭐⭐</div>
      <div className="summary-text">
        <p>This place is amazing! The service is top-notch, and the food is delicious. I highly recommend it.</p>
      </div>
      <div className="author">- John Doe</div>
    </div>
  );
};

export default ReviewSummary;
